const VISA  = () => {
  return (
    
      <div className="visacomponents">
        {" "}
        <img className='visaimg' src={Visa} width="320px" height="274px" ></img>{" "}
        <p className="visaone">Visa </p>
        <p className='visatwo'>Studying abroad is all about choosing the right destination, university and course. Read along some interesting articles to make the most of your international education experience. </p>
      </div>
    
  );
};

export default VISA ;
